    <title>Templete</title>
    <style>
      * {
        margin: 0;
      }
      .preloader {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        margin: 0;
        background-color: #22316c;
        pointer-events: none;
        cursor: not-allowed;
      }
      .spinner-logo {
        width: 6.5em;
        position: absolute;
        top: 54%;
        left: 51.3%;
        transform: translate(-50%, -50%);
      }
      .spinner {
        --size: 90px;
        --first: #b9b5b3;
        --second: #fed500;
        width: 100px;
        height: 100px;
        position: relative;
        animation: noSpin linear infinite;
      }
      .spinner::after,
      .spinner::before {
        content: "";
        width: var(--size);
        height: var(--size);
        border: 4px solid var(--first);
        border-top: 4px solid var(--second);
        border-radius: 50%;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        animation: spinRing 1.5s ease-out infinite;
        box-shadow: 0 0 10px var(--first);
      }
      .spinner::before {
        filter: blur(10px);
      }
      @keyframes spinRing {
        0% {
          transform: translate(-50%, -50%) rotate(0);
        }
        100% {
          transform: translate(-50%, -50%) rotate(360deg);
        }
      }
      @keyframes spin {
        0% {
          transform: rotate(0);
        }
        100% {
          transform: rotate(360deg);
        }
      }
      @keyframes noSpin {
        0% {
          transform: rotate(0);
        }
        100% {
          transform: rotate(0);
        }
      }
    </style>
    <script>
      document.addEventListener("DOMContentLoaded", function () {
        const t = document.querySelector(".preloader");
        let n = Date.now(),
          e;
        function o() {
          var e = Date.now() - n,
            e = Math.max(0, 4e3 - e);
          setTimeout(() => {
            (t.style.opacity = "0"),
              (t.style.transition = "opacity 0.5s ease-out"),
              setTimeout(() => {
                t.style.display = "none";
              }, 500);
          }, e);
        }
        window.addEventListener("load", function () {
          (e = Date.now()), o();
        }),
          setTimeout(o, 4e3);
      });
    </script>
